import 'package:json_annotation/json_annotation.dart';part 'user_model.g.dart';@JsonSerializable()class UserModel {  Tokens? tokens;  User? user;  UserModel({this.tokens, this.user});  factory UserModel.fromJson(Map<String, dynamic> json) =>      _$UserModelFromJson(json);  Map<String, dynamic> toJson() => _$UserModelToJson(this);}@JsonSerializable()class Tokens {  String? accessToken;  String? refreshToken;  Tokens({this.accessToken, this.refreshToken});  factory Tokens.fromJson(Map<String, dynamic> json) =>      _$TokensFromJson(json);  Map<String, dynamic> toJson() => _$TokensToJson(this);}@JsonSerializable()class User {  int? id;  String? email;  String? nickname;  User({this.id, this.email, this.nickname});  factory User.fromJson(Map<String, dynamic> json) => _$UserFromJson(json);  Map<String, dynamic> toJson() => _$UserToJson(this);}